package com.frysning.springdnd.action_type;import com.fasterxml.jackson.annotation.JsonProperty;import javax.persistence.*;@Entity@Table(name = "action_type")public class ActionType {	@JsonProperty(index = 1)	private @Id	@GeneratedValue(strategy = GenerationType.IDENTITY) Long id;	@JsonProperty(index = 2)	private String name;	public String getName() {		return name;	}	public void setName(String name) {		this.name = name;	}}